function Model(){self.submitAttempted=ko.observable(!1);self.save=function(){return self.submitAttempted(!0),self.disclaimerValid()?!0:void 0};self.disclaimerRead=ko.observable(!1);self.disclaimerAgreement=ko.observable(!1);self.disclaimerValid=ko.computed(function(){return self.disclaimerAgreement()||self.disclaimerRead()});self.scrollDisclaimer=function(n,t){var i=$(t.currentTarget);i.scrollTop()+i.innerHeight()+1>=t.currentTarget.scrollHeight&&self.disclaimerRead(!0)}}var model=new Model;ko.applyBindings(model);